import React from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { ucitajSvePredmete } from '../redux/predmeti/actions';

const Predmeti = () => {
  const predmeti = useSelector((state) => state.nastavnici);
  const dispatch = useDispatch();

  return (
    <div>
      {predmeti && (
        <button
          onClick={() => {
            dispatch(ucitajSvePredmete());
          }}
        >
          Svi predmeti
        </button>
      )}

      {predmeti.items.map((nast) => {
        return (
          <div key={nast.idNastavnik} className={styles.predmeti}>
            <Nastavnik
              id={nast.idNastavnik}
              ime={nast.ime}
              prezime={nast.prezime}
            />
            <Link to={'/predmeti/' + nast.idNastavnik} state={nast}>
              Details
            </Link>
          </div>
        );
      })}
    </div>
  );
};

export default Predmeti;
